script: |
  super -f text -I q10798.spq | sort > q10798.out

inputs:
  - name: q10798.spq
    data: |
      SELECT MIN ( ( col1 ) ) + - COUNT ( CAST ( col1 AS INTEGER ) ) FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - 68 * - col2 * + col0 IN ( - - col2 * + col2 + + + 73 );
  - name: tab1

outputs:
  - name: q10798.out
    data: |
      2
